def _maybe_empty_lines(self, current_line: Line) -> Tuple[int, int]:
    max_allowed = 1
    if current_line.depth == 0:
        max_allowed = 2

    newlines_before = 0
    newlines_after = 0

    if current_line.leaves:
        # Consume the first leaf's extra newlines.
        first_leaf = current_line.leaves[0]
        newlines_before = min(first_leaf.prefix.count("\n"), max_allowed)
        first_leaf.prefix = ""

    depth = current_line.depth
    while self.previous_defs and self.previous_defs[-1] >= depth:
        self.previous_defs.pop()
        newlines_before = 1 if depth else 2

    is_decorator = current_line.is_decorator
    if is_decorator or current_line.is_def or current_line.is_class:
        if not is_decorator:
            self.previous_defs.append(depth)
        if self.previous_line is None:
            # Don't insert empty lines before the first line in the file.
            return 0, 0
        if self.previous_line and self.previous_line.is_decorator:
            # Don't insert empty lines between decorators.
            return 0, 0
        newlines_after = 1 if current_line.depth else 0

    elif current_line.is_flow_control:
        newlines_before = 0
        newlines_after = 1

    elif self.previous_line and self.previous_line.is_import and not current_line.is_import and depth == self.previous_line.depth:
        newlines_before = 1 if newlines_before == 0 else newlines_before

    elif self.previous_line and self.previous_line.is_yield and (not current_line.is_yield or depth != self.previous_line.depth):
        newlines_before = 1 if newlines_before == 0 else newlines_before

    return newlines_before, newlines_after
